import React from 'react';
import './App.css';
import { BrowserRouter, BrowserRouter as Route, Router } from 'react-router-dom'
import AlumnoComponent from './components/AlumnoComponent';

function App() {
  return (
    <div>
      <BrowserRouter>
        <Router>
          <Route path="/" exact component={AlumnoComponent}></Route>
        </Router>
      </BrowserRouter>
    </div>
  );
}
export default App;
